BEGIN TRANSACTION;
DROP TABLE IF EXISTS "contact_app_address";
CREATE TABLE IF NOT EXISTS "contact_app_address" (
	"Address_id"	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	"Address_type"	varchar(50),
	"Street"	varchar(100),
	"City"	varchar(50),
	"State"	varchar(50),
	"Zip"	integer,
	"Contact_id"	integer NOT NULL,
	FOREIGN KEY("Contact_id") REFERENCES "contact_app_contact"("Contact_id") DEFERRABLE INITIALLY DEFERRED
);
DROP INDEX IF EXISTS "contact_app_address_Contact_id_89303d5c";
CREATE INDEX IF NOT EXISTS "contact_app_address_Contact_id_89303d5c" ON "contact_app_address" (
	"Contact_id"
);
COMMIT;
